import React from "react";
import {
  Card,
  CardImg,
  CardText,
  CardBody,
  CardTitle,
  CardSubtitle,
  Button
} from "reactstrap";
import moment from "moment";
import { EventResponse } from "../../../requests/eventTypes";

type Props = {
  event: EventResponse;
};

const EventCard = ({ event }: Props) => {
  const { name, date, attendees, rsvps } = event;

  const attendancePercent = Math.round((attendees / rsvps) * 100);
  return (
    <Card>
      <h4>{name}</h4>
      <CardSubtitle style={{ fontSize: 8 }}>
        {moment(date).format("MM/DD/YY")}
      </CardSubtitle>
      <CardText>
        Attendance: {event.attendees} / {event.rsvps} ({attendancePercent}%)
      </CardText>
    </Card>
  );
};

export default EventCard;
